import React from "react";

const ImgListItem03 = ({ onClick, imgSrc, title, textPrimary, location }) => {
  return (
    <li className="item">
      <a onClick={onClick}>
        <div className="imgWrap">
          <img src={imgSrc} className="img-fluid" alt="" />
        </div>
        <div className="InfoWrap">
          <h6>{title}</h6>
          <p>
            <strong className="text-primary">{textPrimary}</strong>
            {location}
          </p>
        </div>
      </a>
    </li>
  );
};

export default ImgListItem03;
